(143, 11, '_et_pb_truncate_post', '<p><div class=\"et_pb_section et_pb_section_0 et_pb_equal_columns et_pb_section_video_on_hover et_section_specialty\" >\n				\n				\n				\n				\n				<span class=\"et_pb_background_mask\"></span>\n				<div class=\"et_pb_row\">\n				<div class=\"et_pb_column et_pb_column_1_2 et_pb_column_0    et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_with_border et_pb_module et_pb_image et_pb_image_0 et_animated et-waypoint et_pb_image_sticky\">\n				\n				\n				\n				\n				<span class=\"et_pb_image_wrap \"><img decoding=\"async\" width=\"2048\" height=\"2560\" src=\"https://ilhamazis.com/wp-content/uploads/2022/11/IMG_0027-2-1-scaled.jpg\" alt=\"\" title=\"Ilham Azis Photo\" srcset=\"https://ilhamazis.com/wp-content/uploads/2022/11/IMG_0027-2-1-scaled.jpg 2048w, https://ilhamazis.com/wp-content/uploads/2022/11/IMG_0027-2-1-1280x1600.jpg 1280w, https://ilhamazis.com/wp-content/uploads/2022/11/IMG_0027-2-1-980x1225.jpg 980w, https://ilhamazis.com/wp-content/uploads/2022/11/IMG_0027-2-1-480x600.jpg 480w\" sizes=\"(min-width: 0px) and (max-width: 480px) 480px, (min-width: 481px) and (max-width: 980px) 980px, (min-width: 981px) and (max-width: 1280px) 1280px, (min-width: 1281px) 2048px, 100vw\" class=\"wp-image-52\" /></span>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_2 et_pb_column_1   et_pb_specialty_column  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_row_inner et_pb_row_inner_0\">\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_inner et_pb_column_inner_0 et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_0 et_animated  et_pb_text_align_left et_pb_bg_layout_dark\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">SYSTEM ADMINISTRATOR</div>\n			</div><div class=\"et_pb_module et_pb_text et_pb_text_1 et_animated  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">ILHAM AZIS</div>\n			</div><div class=\"et_pb_button_module_wrapper et_pb_button_0_wrapper et_pb_button_alignment_left et_pb_module \">\n				<a class=\"et_pb_button et_pb_button_0 et_animated et_pb_bg_layout_light\" href=\"https://www.linkedin.com/in/ilham-azis/\" target=\"_blank\">About Me</a>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row_inner et_pb_row_inner_1\">\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_inner et_pb_column_inner_1 et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_2 et_animated  et_pb_text_align_justified et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">My name is Ilham Azis, a System Administrator at Jagoan Hosting Indonesia with the responsibility of providing product information, solving customer problems, and carrying out maintenance and support services. I am consistent to continue to add insight, make connections, and have a commitment to achieve my career.<br />\nYou can contact me, if you would like to discuss in the near futureilhamazis380@gmail.com</div>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row_inner et_pb_row_inner_2\">\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_inner et_pb_column_inner_2 et-last-child\">\n				\n				\n				\n				\n				<ul class=\"et_pb_module et_pb_social_media_follow et_pb_social_media_follow_0 et_animated clearfix  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<li\n            class=\'et_pb_with_border et_pb_social_media_follow_network_0 et_pb_social_icon et_pb_social_network_link  et-social-facebook\'><a\n              href=\'https://www.facebook.com/ilhamazis380/\'\n              class=\'icon et_pb_with_border\'\n              title=\'Ikuti di Facebook\'\n               target=\"_blank\"><span\n                class=\'et_pb_social_media_follow_netwo