pb_text_align_center\">\n				\n				\n				\n				\n				\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row et_pb_row_1 et_animated\">\n				<div class=\"et_pb_column et_pb_column_4_4 et_pb_column_3  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_3 et_animated  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">PROFFESIONAL EXPERIENCE</div>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row et_pb_row_2 et_animated\">\n				<div class=\"et_pb_column et_pb_column_1_3 et_pb_column_4  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_4  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">Jagoan Hosting Indonesia</div>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_3 et_pb_column_5  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_5  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">System AdministratorJul 2022 &#8211; now</div>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_3 et_pb_column_6  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_6  et_pb_text_align_justified et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">Monitoring layanan dan sistem pendukung layanan<br />\nMenangani dan troubleshooting insiden<br />\nTo do list untuk kegiatan preventif<br />\nMelakukan proses maintenance untuk optimasi<br />\nMelakukan eksekusi usulan perbaikan</div>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row et_pb_row_3 et_animated\">\n				<div class=\"et_pb_column et_pb_column_1_3 et_pb_column_7  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_7  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">Jagoan Hosting Indonesia</div>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_3 et_pb_column_8  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_8  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">Technical Support SpecialistJul 2021 &#8211; Jul 2022</div>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_3 et_pb_column_9  et_pb_css_mix_blend_mode_passthrough et-last-child\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_9  et_pb_text_align_justified et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">Memberikan bantuan pelanggan terkait administrasi, billing ataupun teknis pada channel yang sudah ditentukan<br />\nMenyediakan informasi layanan kepada customer maupun potensial customer pada channel yang sudah ditentukan<br />\nMenyediakan informasi layanan kepada customer maupun potensial customer pada channel yang sudah ditentukan</div>\n			</div>\n			</div>\n				\n				\n				\n				\n			</div><div class=\"et_pb_row et_pb_row_4 et_animated\">\n				<div class=\"et_pb_column et_pb_column_1_3 et_pb_column_10  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_10  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n				\n				\n				\n				<div class=\"et_pb_text_inner\">CV Tani Desa</div>\n			</div>\n			</div><div class=\"et_pb_column et_pb_column_1_3 et_pb_column_11  et_pb_css_mix_blend_mode_passthrough\">\n				\n				\n				\n				\n				<div class=\"et_pb_module et_pb_text et_pb_text_11  et_pb_text_align_left et_pb_bg_layout_light\">\n				\n			